1. Sebelum April 1979, yang digunakan sebagai dasar yaitu September 1966 ( September 1966 = 100 )&lt;br /&gt;
2. Mulai April 1979, digunakan istilah Indeks Harga Konsumen (sebelumnya menggunakan istilah Index Biaya Hidup). Dasarnya April 1977-Maret 1978. Menggunakan pola konsumsi hasil SBH (Survey Biaya Hidup ) tahun 1977/1978 di 17 ibukota propinsi ( April 1977-Maret 1978 = 100 ).&lt;br /&gt;
3. Mulai April 1990-1997, IHK menggunakan tahun dasar 1988/1989. Menggunakan pola konsumsi biaya hidup hasil SBH di 27 ibukota propinsi. (1988/1989 = 100 )&lt;br /&gt;
4. Mulai Desember 1997, IHK menggunakan pola konsumsi hasil SBH di 44 Kota tahun 1996. ( 1996 = 100)&lt;br /&gt;
5. Mulai Januari 2004, digunakan tahun dasar 2002. IHK dihitung berdasarkan pola konsumsi hasil SBH di 45 kota tahun 2002 ( 2002 = 100 )&lt;br /&gt;
6. Mulai Juni 2008, digunakan tahun dasar 2007, IHK dihitung berdasarkan pola konsumsi hasil SBH di 66 kota tahun 2007 (2007 = 100)&lt;br /&gt;
7. Mulai Tahun 2014, digunakan tahun dasar 2012, IHK dihitung berdasarkan pola konsumsi hasil SBH di 82 kota tahun 2012 (2012 = 100)

