Sumber: Biro Pengendalian operasi, Markas Besar Kepolisian Negara Republik Indonesia &lt;br /&gt;						
Catatan: &lt;br /&gt;						
1. Polda Kepulauan Riau tahun 2000-2004 merupakan bagian dari Polda Riau, Polda Kep. Bangka Belitung tahun 2000-2004 merupakan bagian dari Polda Sumatera Selatan, Polda Banten tahun 2000-2003 merupakan bagian dari Polda Jawa Barat, Polda Gorontalo tahun 2000-2003 merupakan bagian dari Polda Sulut, Polda Maluku Utara tahun 2000-2004 merupakan bagian dari Polda Maluku &lt;br /&gt;						
2. Polda Metro Jaya meliputi Polres Jakarta Selatan, Jakarta Timur, Jakarta Pusat, Jakarta Utara, Jakarta Barat, Kepulauan Seribu, Kabupaten Bekasi, Kota Bekasi,Kabupaten Tangerang, Kota Tangerang, Kota Depok, Bandara Soekarno-Hatta, dan Kesatuan Pelaksanaan Pengamanan Pelabuhan (KP3) Tanjung Priok 	&lt;br /&gt;					
3. Polda Kalimantan Utara baru terbentuk pada tahun 2018. Pada tahun 2000-2017, Polda Kalimantan Utara merupakan bagian dari Polda Kalimantan Timur

Sumber: BPS-RI, Susenas 2003-2017 &lt;br /&gt;
Kenaikan Angka Buta Huruf perbandingan tahun 2010 dan 2011 disebabkan:&lt;br /&gt;
1. Perbedaan metodologi penghitungan estimasi. Pada tahun 2010, penghitungan inflate tidak didasarkan pada kelompok umur 5 tahunan (0-4, 5-9, 10-14,..)&lt;br /&gt;
sedangkan pada tahun 2011, penghitungan inflatenya berdasarkan kelompok umur 5 tahunan.&lt;br /&gt;
2. Pengumpulan data pada tahun 2010 dilakukan 1 (satu) kali dalam setahun yaitu pada bulan Juli, sedangkan pada tahun 2011 dilakukan triwulanan. Hal ini mempengaruhi penghitungan indikator pendidikan&lt;br /&gt;
karena tahun ajaran sekolah yang dimulai pada bulan Juli berakhir pada bulan Juni tahun berikutnya.&lt;br /&gt;
3. Data tahun 2011-2017 diestimasi dengan menggunakan inflate hasil back-casting berdasarkan proyeksi penduduk Indonesia 2010-2035&lt;br /&gt;

