&lt;li&gt;Mulai Triwulan IV 2019 terdapat perubahan struktur pada Sektor Pertanian. Sebelumnya Hortikultura merupakan bagian dari Subsektor Tanaman Bahan Makanan. Namun mulai Triwulan IV 2019 Hortikultura dimunculkan sebagai subsektor tersendiri dengan asumsi termasuk komoditas strategis yang perlu dipantau harganya dari waktu ke waktu. Hal ini berdampak pada perubahan  nilai IHP Subsektor Tanaman Pangan. Selain itu, Subsektor Kehutanan tidak lagi dimunculkan sebagai subsektor dengan pertimbangan bahwa ketersediaan data kehutanan kurang representatif untuk menggambarkan perubahan harga dari waktu ke waktu.&lt;/li&gt;
