&lt;p&gt;Catatan:&lt;/p&gt;

&lt;p&gt;Sejak tahun 2019, konsep yang digunakan mengacu pada metadata SDGs dimana rumah tangga dikatakan memiliki akses terhadap layanan sanitasi layak apabila rumah tangga memiliki fasilitas tempat Buang Air Besar (BAB) yang digunakan sendiri atau bersama rumah tangga tertentu (terbatas) ataupun di MCK Komunal, menggunakan jenis kloset leher angsa, dan tempat pembuangan akhir tinja di tangki septik atau IPAL atau bisa juga di lubang tanah jika wilayah tempat tinggalnya di perdesaan.&lt;/p&gt;

&lt;p&gt;*)Backcasting&lt;/p&gt;

&lt;p&gt;Catatan:&lt;br&gt;a. Pada tahun 2000 pencacahan Susenas tidak dilakukan di Provinsi NAD (Aceh) dan Maluku &lt;br&gt;b. Pada tahun 2001 pencacahan Susenas tidak dilakukan di Provinsi NAD (Aceh) &lt;br&gt;c. Untuk Provinsi Aceh, Maluku, Maluku Utara, dan Papua, pencacahan Susenas tahun 2002 hanya dilakukan di ibu kota provinsi&lt;/p&gt;

&lt;p&gt;d. Sejak tahun 2019, konsep yang digunakan mengacu pada metadata SDGs dimana rumah tangga dikatakan memiliki akses terhadap layanan sanitasi layak apabila rumah tangga memiliki fasilitas tempat Buang Air Besar (BAB) yang digunakan sendiri atau bersama rumah tangga tertentu (terbatas) ataupun di MCK Komunal, menggunakan jenis kloset leher angsa, dan tempat pembuangan akhir tinja di tangki septik atau IPAL atau bisa juga di lubang tanah jika wilayah tempat tinggalnya di perdesaan.&lt;/p&gt;

