&lt;p&gt;Catatan:&lt;/p&gt;

&lt;p&gt;Sejak tahun 2019, rumah tangga diklasifikasikan memiliki akses terhadap hunian/rumah layak huni apabila memenuhi 4 (empat) kriteria, yaitu:&lt;/p&gt;

&lt;p&gt;1) kecukupan luas tempat tinggal minimal 7,2 m2 per kapita (sufficient living space)&lt;/p&gt;

&lt;p&gt;2) memiliki akses terhadap air minum layak&lt;/p&gt;

&lt;p&gt;3) memiliki akses terhadap sanitasi layak&lt;/p&gt;

&lt;p&gt;4) ketahanan bangunan (durable housing), yaitu atap terluas berupa beton/ genteng/ seng/ kayu/ sirap; dinding terluas berupa tembok/ plesteran anyaman bambu/kawat, kayu/papan dan batang kayu; dan lantai terluas berupa marmer/ granit/ keramik/ parket/vinil/karpet/ ubin/tegel/teraso/ kayu/papan/ semen/bata merah.&lt;/p&gt;

