&lt;p&gt;&lt;br /&gt;&lt;/p&gt;&lt;p&gt;Mulai Januari 2020, BPS melakukan perubahan tahun dasar penghitungan Indeks Harga Perdagangan Besar (IHPB) dari tahun dasar (2010=100) menjadi tahun dasar (2018=100). Perubahan tahun dasar dilakukan sebagai bagian dari proses penyelarasan tahun dasar Indeks Harga Konsumen (IHK) karena IHPB merupakan indikator awal (leading indicator) analisis Harga Konsumen, serta adanya kecenderungan perubahan mekanisme perdagangan secara umum. 

&lt;br /&gt;&lt;br /&gt;Penentuan paket komoditas IHPB (2018=100) berdasarkan Survei Penyusunan Diagram Timbang (SPDT) IHPB, yang menghasilkan sebanyak 687 komoditas dengan jumlah komoditas baru yang terpilih sebanyak 312 komoditas dan yang hilang sebanyak 58 komoditas. Mengacu pada konsep standar internasional, cakupan IHPB (2018=100) meliputi Sektor Pertanian, Sektor Pertambangan dan Penggalian, dan Sektor Industri.

&lt;br /&gt;&lt;br /&gt;Khusus untuk IHPB kelompok Ekspor dan Impor, saat ini dalam proses penyempurnaan metodologi dengan mengacu pada standar internasional: Manual of Export and Import Price Index (XMPI) dan Manual of International Trade Price Index (ITPI). Oleh karena itu, saat ini IHPB Perdagangan Internasional (ekspor-impor) disajikan dengan nama Indeks Harga Perdagangan Internasional (IHPI). Penghitungan IHPI (2010=100) berdasarkan pemantauan terhadap perkembangan harga komoditas dalam kegiatan ekspor dan impor. &lt;br /&gt;&lt;/p&gt;&lt;p&gt;&lt;br /&gt;&lt;/p&gt;

&lt;p&gt;&lt;br /&gt;&lt;/p&gt;&lt;p&gt;&lt;br /&gt;&lt;/p&gt;&lt;p&gt;&lt;br /&gt;&lt;/p&gt;&lt;p&gt;Mulai Januari 2020, BPS melakukan perubahan tahun dasar penghitungan Indeks Harga Perdagangan Besar (IHPB) dari tahun dasar (2010=100) menjadi tahun dasar (2018=100). Perubahan tahun dasar dilakukan sebagai bagian dari proses penyelarasan tahun dasar Indeks Harga Konsumen (IHK) karena IHPB merupakan indikator awal (leading indicator) analisis Harga Konsumen, serta adanya kecenderungan perubahan mekanisme perdagangan secara umum. 

&lt;br /&gt;&lt;br /&gt;Penentuan paket komoditas IHPB (2018=100) berdasarkan Survei Penyusunan Diagram Timbang (SPDT) IHPB, yang menghasilkan sebanyak 687 komoditas dengan jumlah komoditas baru yang terpilih sebanyak 312 komoditas dan yang hilang sebanyak 58 komoditas. Mengacu pada konsep standar internasional, cakupan IHPB (2018=100) meliputi Sektor Pertanian, Sektor Pertambangan dan Penggalian, dan Sektor Industri.

&lt;br /&gt;&lt;br /&gt;Khusus untuk IHPB kelompok Ekspor dan Impor, saat ini dalam proses penyempurnaan metodologi dengan mengacu pada standar internasional: Manual of Export and Import Price Index (XMPI) dan Manual of International Trade Price Index (ITPI). Oleh karena itu, saat ini IHPB Perdagangan Internasional (ekspor-impor) disajikan dengan nama Indeks Harga Perdagangan Internasional (IHPI). Penghitungan IHPI (2010=100) berdasarkan pemantauan terhadap perkembangan harga komoditas dalam kegiatan ekspor dan impor. &lt;br /&gt;&lt;/p&gt;&lt;p&gt;&lt;br /&gt;&lt;/p&gt;&lt;p&gt;&lt;br /&gt;&lt;/p&gt;&lt;p&gt;&lt;br /&gt;&lt;/p&gt;

